import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
    <heroSection />
    <featuresSection />
    </div>
  );
}

function heroSection(){
  return(
    <section id="hero">
        <div class="hero-content">
            <h2>Start learning about finance today</h2>
            <button onclick="showSection('features')">Get Started now</button>
        </div>
    </section>
  );
}

function featuresSection(){
  return(
    <section id="features">
        <div class="feature">
            <h3>Learning Modules</h3>
            <p>Choose from a variety of specific learning modules.</p>
            <button onclick="showSection('learning-modules')">Explore Modules</button>
        </div>
        <div class="feature">
            <h3>Blog</h3>
            <p>Financial News, Tips, and Tricks!</p>
            <button onclick="showSection('blog')">Our Blog</button>
        </div>
    </section>
  );
}

